module.exports = a = async ({params}) => {
	const { 
		ciam_logoUrl, 
		ciam_companyName, 
		ciam_logoStyle,
		flowMethod
	} = params;

	const flowCompanyLogo = (flowMethod === 'WIDGET') 
		? `<div class="dialog-content-header dialog-content__header" style="height: 85px"><div class="dialog-content-header__logo"></div></div>` // For widget, logo is not required as it is rendered on a webpage
		: `<img class="align-self-center mb-5" src="${ciam_logoUrl}" alt="${ciam_companyName}" style="${ciam_logoStyle}"></img>`;

	const flowCompanyGreeting = (flowMethod === 'WIDGET' )
		? '<p class="text-muted text-center mb-5"></p>'
		: `<p class="text-muted text-center">Welcome to ${ciam_companyName}</p>`;

	return { flowCompanyLogo, flowCompanyGreeting }
}

