var errorDiv = document.getElementById('error-wrap');
if (errorDiv) {
  const observer = new MutationObserver((mutations) => {
    mutations.forEach((mutation) => {
      if (mutation.type === 'childList' || mutation.type === 'subtree') {
        contentChanged();
      }
    });
  });

  observer.observe(errorDiv, {
